import React from 'react';
import { Card } from 'antd';
import './App.css';

class CurrencyCard extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            buy: 0.0,
            sell: 0.0
          };
      }

    componentDidMount() {
    fetch("http://localhost:8080/getgemini?currencyType="+this.props.type,
    {
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }

      })
        .then(res => {
            console.log(res)
            res.text()})
        .then(
        (result) => {
            // this.setState({
