            //     sell: result.Sell
            // });
            console.log(result)
        },
        (error) => {
            console.log("ERROR!: "+error);
        }
        )
    }

    render() {
        const { buy, sell } = this.state

            return (
            <div className="App">
                <header className="App-header">
                <Card title={this.props.title}>
                    <p>
                    <br />
                        <b>{this.props.type}:</b>

                        <br />
                            <b>BUY:</b>{buy} 

                            <br />
                            <b>SELL:</b>{sell}

                    </p>
                </Card>
                </header>
            </div>
            );
            }
    }

export default CurrencyCard;
